import React, { Component, Fragment } from "react";
import { Layout, Table } from "antd";

const columns = [
  {
    title: "Name",
    dataIndex: "name",
    render: text => <p>{text}</p>
  },
  {
    title: "Price",
    className: "column-price",
    dataIndex: "price"
  },
  {
    title: "Type",
    dataIndex: "type"
  }
];

const data = [
  {
    key: "1",
    name: "John Brown",
    price: "￥300,000.00",
    address: "New York No. 1 Lake Park"
  },
  {
    key: "2",
    name: "Jim Green",
    money: "￥1,256,000.00",
    address: "London No. 1 Lake Park"
  },
  {
    key: "3",
    name: "Joe Black",
    money: "￥120,000.00",
    address: "Sidney No. 1 Lake Park"
  },
  {
    key: "3",
