    address: "Sidney No. 1 Lake Park"
  },
  {
    key: "3",
    name: "Joe Black",
    money: "￥120,000.00",
    address: "Sidney No. 1 Lake Park"
  },
  {
    key: "3",
    name: "Joe Black",
    money: "￥120,000.00",
    address: "Sidney No. 1 Lake Park"
  }
];

const { Content } = Layout;
export default class Dish extends Component {
  render() {
    return (
      <Fragment>
        <Content style={{ margin: "2em 16px" }}>
          <div style={{ background: "#fff", padding: 24, minHeight: 280 }}>
            <Table
              columns={columns}
              dataSource={data}
              bordered
              title={() => "Dish Menu"}
              footer={() => "Footer"}
              scroll={{ y: 240 }}
            />
          </div>
        </Content>
      </Fragment>
    );
  }
}
